import { Box, Stack, Typography } from "@mui/material";
import React from "react";

const HeroBanner = () => {
  return (
    <Box sx={{
        mt: {lg:'212px',xs:'70px'}, 
        ml: {sm:'50px',xs:'70px'}

    }}pos>
      <Typography color="#FF2625" 
        fontWeight='600' 
        fontSize='26px'>
            Fitness Club
      </Typography>
    </Box>
  );
};

export default HeroBanner;
